import React, { Component } from 'react'

export default class SlotMachine extends Component {
    
    
    render() {
        
        function Slot1() {
            return Math.floor(Math.random() *10 +1)
        }
        const result1 = Slot1();
        function Slot2() {
            return Math.floor(Math.random() *10 +1)
        }
        const result2 = Slot2();
        function Slot3() {
            return Math.floor(Math.random() *10 +1)
        }
        const result3 = Slot3();
        return (
            
            <div>
                <h1>Slot Machine</h1>
                <p>Your number is {result1}</p>
                
                <p>{result1 < 11 ? <img src="data:image/png;base64," alt=''></img>: null}
                </p>
                <p>{result2 < 11 ? <img src="data:image/png;base64," alt=''></img>: null}
                </p>
                <p>{result3 < 11 ? <img src="data:image/jpeg;base64," alt=''></img>: null}
                </p>
                <p>{result1 === result2 === result3 ? 'You WIN!' : 'You Lose'}</p>
            </div>
        )
    }
}
